import React from 'react'
import Navbar from './Nav/Navbar'
import SankeyChart from './Sankey/SankeyChart'
import RadialChart from './components/Radial/RadialChart';

function About() {
  return (
    <>
    <Navbar />
    <SankeyChart />
    <RadialChart />
    </>
  )
}

export default About;
